import copy
from SBOX import *


def initRC():
    global RC
    RC[1][0] = 1
    for i in range(2, 11):
        RC[i][0] = mul(2, RC[i-1][0])


def g(w, index):
    tmp = [0, 0, 0, 0]
    # RotWord
    for i in range(4):
        tmp[i] = w[(i+1) % 4]
    # SubWord
    for i in range(4):
        x, y = getPosition(tmp[i])
        tmp[i] = s_box[x][y]

    rc = RC[int(index/4)]
    for i in range(4):
        tmp[i] = tmp[i] ^ rc[i]
    return tmp


def keyExpansion(key):
    w = [[0]*4 for i in range(44)]
    # 初始化w[0]~w[3]
    for i in range(4):
        for j in range(4):
            w[i][j] = key[i*4+j]

    for i in range(4, 44):
        tmp = w[i-1]
        if i % 4 == 0:
            tmp = g(tmp, i)
        for j in range(4):
            w[i][j] = w[i-4][j] ^ tmp[j]
    return w        


def substituteBytes(arr):
    for i in range(4):
        for j in range(4):
            x, y = getPosition(arr[i][j])
            arr[i][j] = s_box[x][y]
    return arr

def inverseSubtituteBytes(arr):
    for i in range(4):
        for j in range(4):
            x, y = getPosition(arr[i][j])
            arr[i][j] = inverse_s_box[x][y]
    return arr


def shiftRows(s):
    tmp = [[0]*4 for i in range(4)]
    for i in range(4):
        for j in range(4):
            tmp[i][j] = s[i][(j+i) % 4]
    return tmp


def inverseShiftRows(s):
    tmp = [[0]*4 for i in range(4)]
    for i in range(4):
        for j in range(4):
            tmp[i][j] = s[i][(j+4-i) % 4]
    return tmp

# w为密钥
def addRoundKey(s, w, begin):
    for j in range(4):
        for i in range(4):
            s[i][j] = s[i][j] ^ w[j+begin][i]
    return s


def mixColum(s, i, j):
    if i == 0:
        return mul(2, s[0][j]) ^ mul(3, s[1][j]) ^ s[2][j] ^ s[3][j]
    elif i == 1:
        return s[0][j] ^ mul(2, s[1][j]) ^ mul(3, s[2][j]) ^ s[3][j]
    elif i == 2:
        return s[0][j] ^ s[1][j] ^ mul(2, s[2][j] ^ mul(3, s[3][j]))
    else:
        return mul(3, s[0][j]) ^ s[1][j] ^ s[2][j] ^ mul(2, s[3][j])


def inverseMixColum(s, i, j):
    if i == 0:
        return mul(0xe, s[0][j]) ^ mul(0xb, s[1][j]) ^ mul(0xd, s[2][j]) ^ mul(9, s[3][j])
    elif i == 1:
        return mul(0x9, s[0][j]) ^ mul(0xe, s[1][j]) ^ mul(0xb, s[2][j]) ^ mul(0xd, s[3][j])
    elif i == 2:
        return mul(0xd, s[0][j]) ^ mul(0x9, s[1][j]) ^ mul(0xe, s[2][j]) ^ mul(0xb, s[3][j])
    else:
        return mul(0xb, s[0][j]) ^ mul(0xd, s[1][j]) ^ mul(0x9, s[2][j]) ^ mul(0xe, s[3][j])


def mixColumns(s):
    tmp = copy.deepcopy(s)
    for i in range(4):
        for j in range(4):
            s[i][j] = mixColum(tmp, i, j)
    return s


def inverseMixColums(s):
    tmp = copy.deepcopy(s)
    for i in range(4):
        for j in range(4):
            s[i][j] = inverseMixColum(tmp, i, j)
    return s


def mulSBox(arr):
    for i in range(16):
        for j in range(16):
            for z in range(4):
                arr[i][j][z] = mul(s_box[i][j], arr[i][j][z])
    return arr


